import React from 'react';
import {
  Collapse,
  List,
  ListItem,
  ListItemText,
} from '@material-ui/core';

export default function EmployeeDetail() {
  const [open, setOpen] = React.useState(true);
  console.log(open);
  const handleClick = () =>{
    setOpen(!open);
  };
  return(
    <>
      <ListItem button onClick={handleClick} key={props.index}>
        <ListItemText primary={props.employee.first_name}/>
        {open ? <p>Less</p> : <p>More</p>}
      </ListItem>
      <Collapse in={open}>
        <List>
          <ListItem key={props.index}>
            <ListItemText primary="Device"/>
          </ListItem>
        </List>
      </Collapse>
    </>
  );
};
